-- Create table if not exists
CREATE TABLE IF NOT EXISTS water_daily_consumption (
    id SERIAL PRIMARY KEY,
    meter_name TEXT NOT NULL,
    account_number TEXT NOT NULL,
    label TEXT,
    zone TEXT,
    parent_meter TEXT,
    type TEXT,
    month TEXT NOT NULL,
    year INTEGER NOT NULL,
    day_1 DECIMAL(10,3), day_2 DECIMAL(10,3), day_3 DECIMAL(10,3), day_4 DECIMAL(10,3), day_5 DECIMAL(10,3),
    day_6 DECIMAL(10,3), day_7 DECIMAL(10,3), day_8 DECIMAL(10,3), day_9 DECIMAL(10,3), day_10 DECIMAL(10,3),
    day_11 DECIMAL(10,3), day_12 DECIMAL(10,3), day_13 DECIMAL(10,3), day_14 DECIMAL(10,3), day_15 DECIMAL(10,3),
    day_16 DECIMAL(10,3), day_17 DECIMAL(10,3), day_18 DECIMAL(10,3), day_19 DECIMAL(10,3), day_20 DECIMAL(10,3),
    day_21 DECIMAL(10,3), day_22 DECIMAL(10,3), day_23 DECIMAL(10,3), day_24 DECIMAL(10,3), day_25 DECIMAL(10,3),
    day_26 DECIMAL(10,3), day_27 DECIMAL(10,3), day_28 DECIMAL(10,3), day_29 DECIMAL(10,3), day_30 DECIMAL(10,3),
    day_31 DECIMAL(10,3),
    created_at TIMESTAMPTZ DEFAULT NOW(),
    updated_at TIMESTAMPTZ DEFAULT NOW(),
    UNIQUE(account_number, month, year)
);

-- Enable RLS
ALTER TABLE water_daily_consumption ENABLE ROW LEVEL SECURITY;

-- Drop existing policies if they exist
DROP POLICY IF EXISTS "Allow anonymous read access" ON water_daily_consumption;
DROP POLICY IF EXISTS "Allow anonymous insert" ON water_daily_consumption;
DROP POLICY IF EXISTS "Allow anonymous update" ON water_daily_consumption;
DROP POLICY IF EXISTS "Allow anonymous delete" ON water_daily_consumption;

-- Create policies
CREATE POLICY "Allow anonymous read access" ON water_daily_consumption FOR SELECT TO anon USING (true);
CREATE POLICY "Allow anonymous insert" ON water_daily_consumption FOR INSERT TO anon WITH CHECK (true);
CREATE POLICY "Allow anonymous update" ON water_daily_consumption FOR UPDATE TO anon USING (true);
CREATE POLICY "Allow anonymous delete" ON water_daily_consumption FOR DELETE TO anon USING (true);

